#include <algorithm>
#include <iostream>
#include <vector>

using std::cin;
using std::cout;
using std::endl;
using std::vector;

const int64_t kMod = 123'456'789;

int main() {
    int cnt;
    cin >> cnt;
    vector < int > labels(cnt);
    for (auto &label: labels) {
        cin >> label;
    }
    sort(labels.begin(), labels.end());
    vector < vector < int64_t > > dp(cnt + 1, vector < int64_t >(cnt + 1, 0));
    for (int left = 0; left < cnt; ++left) {
        dp[left][left + 1] = 1;
        dp[left][left] = 1;
    }
    dp[cnt][cnt] = 1;
    for (int sz = 2; sz <= cnt; ++sz) {
        for (int left = 0, right = sz; right <= cnt; ++left, ++right) {
            dp[left][right] += dp[left + 1][right];
            dp[left][right] %= kMod;
            for (int root = left + 1; root < right; ++root) {
                if (labels[root - 1] < labels[root]) {
                    dp[left][right] += (dp[left][root] * dp[root + 1][right]) % kMod;
                    dp[left][right] %= kMod;
                }
            }
        }
    }
    cout << dp[0][cnt];
}

